/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"container\">\n    <div class=\"row align-items-center\">\n        <div class=\"col\">\n            <h1>Care-athon</h1>\n            <div>\n                <p>\n                    Op donderdag 20 en vrijdag 21 februari 2020 stond er de care-athon op het programma voor de derdejaars. Deze care-athon was een soort van hackathon, maar in plaats van één volledige dag, was hij verdeeld over twee dagen. Ook speciaal aan deze care-athon was dat die volledig in het teken stond van de zorgsector. Vandaar ook de naam care-athon. Er waren vier verschillende cases: spelletjes maken voor de bewoners van Sint-Oda, een app voor een wens ambulance, een app voor het organiseren van kinderopvang en tot slot een app voor G-karate. Ikzelf heb deelgenomen aan de hackathon van G-Karate omdat deze opdracht mij het meest interessant leek. \n                </p>\n                <p>\n                    De bedoeling van deze care-athon was om een app te ontwikkelen die gebruikt kan worden door zowel kinderen, jongeren en volwassenen die een speciale behoefte hebben om hun de grondbeginselen van karate bij te brengen. De app moest gebruik maken van kleuren, iconen en cijfers om zo met eenvoudige instructies allerlei leuke trainingen mogelijk te maken. \n                </p>\n                <img class=\"picture\" src=\"../../assets/care-athon/foto1.png\">\n                <p>\n                    Aan het begin van de eerste dag werden we verwelkomd en werd de case ons nog eens duidelijk uitgelegd. Nadien werden we in verschillende groepjes verdeeld. Ikzelf zat in groep 4. Na de verdeling en tijdens de eerste kennismaking met mijn groepsleden kwam een eerste probleem naar voren, de andere drie groepsleden waren alle drie SNB-studenten, waardoor ik de enige AON-student was. Hierdoor moest ik dus al het programmeerwerk op mij nemen. Maar ja, hier konden we nog wel omheen werken. \n                </p>\n                <img class=\"picture\" src=\"../../assets/care-athon/foto3.png\">\n                <p>\n                    Toen konden we er aan beginnen. Als eerste moesten we een idee bedenken van hoe en wat we juist wilden maken. Dit verliep nogal stroef totdat één van de begeleiders ons kwam helpen en ons zo een duwtje in de rug gegeven had. Na nog even te brainstormen kwamen we op het idee dat we uiteindelijk ook ontwikkeld hebben. We maakten een app die zowel door de trainer als door de personen met speciale behoeften gebruikt kan worden. Na deze juiste modus gekozen te hebben, moest je kiezen welke soort oefeningen je graag wou leren: karate, voetbal, tennis,… Hiervan hadden we om het op korte tijd programmeerbaar te houden enkel het belangrijkste deel, dus het karatedeel, van geïmplementeerd. Na de keuze van de sport gemaakt te hebben zou je weer een keuze moeten maken uit een lijst van mogelijke oefeningen. Eenmaal je dit gekozen had begon de oefening en als hij klaar was kreeg je nog een eindscherm. Voor de oefeningen werd er gebruik gemaakt van gif bestanden die een persoon de oefening laat uitbeelden.\n                </p>\n                <img class=\"center\" src=\"../../assets/care-athon/gif1.gif\">\n                <p>\n                    Tijdens deze twee dagen heb ik heel de tijd de app zitten programmeren. Gelukkig maar, want dit doe ik liever dan de presentatie maken of de pitch voorbereiden. Na ongeveer anderhalve dag zijn we tot het eindresultaat dat we afgeleverd hebben gekomen. Toen kwam de jury langs en deze leek wel tevreden te zijn met het product dat we aan hen voorstelden. Helaas zijn we niet in de top 2 van onze care-athon geraakt, waardoor we niet hebben moeten pitchen. Maar als ik naar de producten kijk van de andere groepen lijkt dit me ook niet onterecht te zijn.   \n                </p>\n                <img class=\"picture\" src=\"../../assets/care-athon/foto2.png\">\n                <h4>Reflectie</h4>\n                <p>\n\n                </p>\n            </div>\n        </div>\n    </div>\n</div>\n\n");

