/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"container\">\n    <div class=\"row align-items-center\">\n        <div class=\"col\">\n            <h1>Studiereis Duitsland</h1>\n            <div>\n                <p>\n                    Voor het onderdeel internationalisering heb ik gekozen om deel te nemen aan de studiereis naar Duitsland. Initieel had ik me ingeschreven voor de studiereis naar Duitsland die enkel naar Berlijn ging, maar omdat ik van vrienden te horen kreeg dat de optie die eerst ook naar Paderborn ging leuker zou zijn, ben ik nog snel overgeschakeld. En dit heb ik me niet beklaagd.\n                </p>\n                <p>\n                    Na nog even de jobbeurs bezocht te hebben vertrokken we met de bus op woensdag 12 februari richting Paderborn. Een trip van zo’n vier uur. In de bus gaf meneer Parren wat uitleg over wat we de komende dagen gingen doen en werden enkele afspraken duidelijk gemaakt. Eenmaal in Paderborn aangekomen, moesten we inchecken in onze kamers en hadden we nog een vrije avond. \n                </p>\n                <p>\n                    De dag daarna begon de echte studiereis. We gingen met zen allen naar het Fraunhofer instituut waar we deel gingen nemen aan een makeathon. Dit is een soort van hackathon waar de focus meer ligt op het proces van dingen samen te maken, en niet zo zeer op het eindresultaat. Het doel van deze makeathon was om een innoverend idee uit te denken dat te maken had met de rolluiken van het bedrijf Heroal. We werden in groepjes van vijf opgedeeld met iedereen een eigen rol binnen het team. Ikzelf zat in groep 1 samen met Jens Beernaert, Jarne Creten, Rubin Beckers en Robby Corvers en kreeg de rol ontwikkelaar toegewezen. Het was mijn taak om de landing-page voor de website van ons idee uit te werken.  \n                </p>\n                <img class=\"picture\" src=\"../../assets/studiereis/foto1.jpg\">\n                <p>\n                    De bedoeling van de makeathon was om een idee te bedenken om iets innoverend te doen met de rolluiken met motor van Heroal, maar na onze eerste pitch werd ons aangeraden om een andere aanpak te nemen. Ons idee was eigenlijk meer een service die we extra zouden kunnen aanbieden aan de mensen van Heroal. We bedachten een manier om via de sensoren die in de motor van de rolluiken en een API ervoor te zorgen dat er een dashboard ontwikkeld zou kunnen worden waarop dan duidelijk gemaakt kan worden hoe het met de motor en de rolluiken gesteld is. Hierdoor zou Heroal dan de contracten die ze afsluiten en de garantie die ze aanbieden kunnen afstellen naar de resultaten en gegevens die ze uit de data die wij aanbieden, kunnen halen. Het idee kreeg de naam WearId, naar Wear, de slijtage, en Id, zoals idea, een idee krijgen over de slijtage.\n                </p>\n                <img class=\"picture\" src=\"../../assets/studiereis/foto2.png\">\n                <p>\n                    Alles werd in goede banen geleid door de mensen van Fraunhofer en er werd ook gratis drank en eten aangeboden. Top.\n                </p>\n                <p>\n                    Na twee dagen in Paderborn, reisden we donderdagavond verder naar Berlijn. Opnieuw een trip van zo’n vier uur. Toen we hier aankwamen rond tien uur ’s avonds hadden we nog een vrije avond. Hier hebben we goed van geprofiteerd en zijn nog tot de vroege uurtjes uit geweest.\n                </p>\n                <p>\n                    Dag één in Berlijn stond er in de voormiddag een rondrit in een bus door de stad op het programma. Tijdens deze rondleiding hebben we heel wat toeristische plekken gezien zoals Checkpoint Charlie en de Siegessäule. Na deze rondrit met de bus hadden we na de middag nog een toeristische wandeling met gids op het programma. Zij heeft ons heel wat extra uitleg gegeven over alle grote gebouwen die we tegenkwamen en enkele belangrijke gebeurtenissen die er in het verleden op deze plaatsen gebeurt zijn. \n                </p>\n                <img class=\"picture\" src=\"../../assets/studiereis/foto3.png\">            \n                <p>\n                    Op dag twee in Berlijn stond een bezoek aan Stasigevangenis Hohenschönhausen op het programma. Hier hadden we niet het geluk dat we de rondleiding kregen van een ex-gevangene, maar dat maakte het er niet minder interessant op. We leerden er bij over hoe de gevangenen in die tijd behandeld werden en hoe ze probeerden hun vertrouwen te winnen om zo nog meer mensen op te kunnen pakken. In de namiddag stond een rondleiding in de verlaten Tempelhof luchthaven op het programma. Hier kregen we uitleg over wat alle plaatsen in de luchthaven juist waren en waarom hij nooit helemaal af is geraakt.\n                </p>\n                <img class=\"picture\" src=\"../../assets/studiereis/foto4.jpg\">   \n                <p>\n                    Tot slot stond er op maandag een hele dag terugrit richting België op het programma. Hier heb ik geleerd dat ik vrij lange benen heb en dat dat niet zo aangenaam is als je negen uur lang in een bus moet zitten.  \n                </p>\n                <h4>Reflectie</h4>\n                <p>\n                    Als ik nu terugdenk aan de studiereis naar Duitsland krijg ik een lach op mijn gezicht. Ik heb het er heel naar mijn zin gehad, ook al had ik dat in het begin zeker niet verwacht. Voor we vertrokken keek ik er niet echt naar uit. Vijf dagen naar Duitsland wat dingen gaan doen, ik wist niet of ik dit wel leuk zou vinden. Maar ik heb van zowel het eerste deel in Paderborn als het tweede in Berlijn fel genoten. Ik had nog nooit aan een makeathon of hackathon meegedaan, dus dit was helemaal nieuw voor mij. Ik wist niet wat er juist allemaal van mij verwacht zou worden en of ik dit dan zou kunnen. Maar uiteindelijk is dit zeer goed meegevallen. Het was de bedoeling dat we in groepjes samen zouden brainstormen en tot een innoverend idee zouden komen. Dit is voor mij goed, want dat wil zeggen dat ik uit mijn comfortzone moet komen om mee te helpen met de opdracht. Ik heb soms moeite met mijn eigen mening te zeggen en niet gewoon met de rest mee te gaan, maar ik vind dat ik dat in deze opdracht toch goed gedaan heb. Aan het pitchen zelf van ons idee heb ik wel niet mee gedaan. Dit is iets wat ik echt niet graag doe. Dit zou ik misschien in de toekomst wel meer moeten doen omdat je dat zo meer gewoon wordt. Wat ik wel geleerd heb, is dat een hackathon zeer interessant kan zijn en dat ik hier in de toekomst misschien wel meer deel aan wil nemen.\n                </p>\n                <p>\n                    Over het tweede deel van de studiereis in Berlijn valt niet veel te reflecteren. Het enige wat ik hier kan zeggen is dat ik van mezelf vind dat ik altijd goed geluisterd heb naar de uitleg die de mensen gaven en hierdoor heel wat over Berlijn en Duitsland in het algemeen bijgeleerd heb. \n                </p>\n            </div>\n        </div>\n    </div>\n</div>\n");

